  /**
   * Create one Tier
   * @param tier Tier entity.
   * @param observe set whether or not to return the data Observable as the body, response or events. defaults to returning the body.
   * @param reportProgress flag to report request and response progress.
   */
  public tiersPost(
    tier: Tier,
    observe?: 'body',
    reportProgress?: boolean,
  ): Observable<Tier>;
  public tiersPost(
    tier: Tier,
    observe?: 'response',
    reportProgress?: boolean,
  ): Observable<HttpResponse<Tier>>;
  public tiersPost(
    tier: Tier,
    observe?: 'events',
    reportProgress?: boolean,
  ): Observable<HttpEvent<Tier>>;
  public tiersPost(
    tier: Tier,
    observe: any = 'body',
    reportProgress: boolean = false,
  ): Observable<any> {
    if (tier === null || tier === undefined) {
      throw new Error(
        'Required parameter tier was null or undefined when calling tiersPost.',
      );
    }

    let headers = this.defaultHeaders;

    // to determine the Accept header
    const httpHeaderAccepts: string[] = ['application/json'];
    const httpHeaderAcceptSelected:
      | string
      | undefined = this.configuration.selectHeaderAccept(httpHeaderAccepts);
    if (httpHeaderAcceptSelected !== undefined) {
      headers = headers.set('Accept', httpHeaderAcceptSelected);
    }

    // to determine the Content-Type header
    const consumes: string[] = ['application/json'];
    const httpContentTypeSelected:
      | string
      | undefined = this.configuration.selectHeaderContentType(consumes);
    if (httpContentTypeSelected !== undefined) {
      headers = headers.set('Content-Type', httpContentTypeSelected);
    }

    return this.httpClient.post<Tier>(
      `${this.configuration.basePath}/tiers`,
      tier,
      {
        withCredentials: this.configuration.withCredentials,
        headers,
        observe,
        reportProgress,
      },
    );
  }
